ll,\n      \"defaultValue\" : null,\n      \"validateType\" : \"\",\n      \"error\" : \"\",\n      \"expression\" : \"\",\n      \"children\" : [ {\n        \"name\" : \"\",\n        \"value\" : \"\",\n        \"description\" : \"\",\n        \"required\" : false,\n        \"dataType\" : \"Object\",\n        \"type\" : null,\n        \"defaultValue\" : null,\n        \"validateType\" : \"\",\n        \"error\" : \"\",\n        \"expression\" : \"\",\n        \"children\" : [ {\n          \"name\" : \"lang\",\n          \"value\" : \"jp\",\n          \"description\" : \"\",\n          \"required\" : false,\n          \"dataType\" : \"String\",\n          \"type\" : null,\n          \"defaultValue\" : null,\n          \"validateType\" : \"\",\n          \"error\" : \"\",\n          \"expression\" : \"\",\n          \"children\" : [ ]\n        }, {\n          \"name\" : \"content\",\n          \"value\" : \"焼肉店\",\n          \"description\" : \"\",\n          \"required\" : false,\n          \"dataType\" : \"String\",\n          \"type\" : null,\n          \"defaultValue\" : null,\n          \"validateType\" : \"\",\n          \"error\" : \"\",\n          \"expression\" : \"\",\n          \"children\" : [ ]\n        } ]\n      } ]\n    } ]\n  },\n  \"responseBodyDefinition\" : {\n    \"name\" : \"\",\n    \"value\" : \"\",\n    \"description\" : \"\",\n    \"required\" : false,\n    \"dataType\" : \"Object\",\n    \"type\" : null,\n    \"defaultValue\" : null,\n    \"validateType\" : \"\",\n    \"error\" : \"\",\n    \"expression\" : \"\",\n    \"children\" : [ {\n      \"name\" : \"code\",\n      \"value\" : \"200\",\n      \"description\" : \"\",\n      \"required\" : false,\n      \"dataType\" : \"Integer\",\n      \"type\" : null,\n      \"defaultValue\" : null,\n      \"validateType\" : \"\",\n      \"error\" : \"\",\n      \"expression\" : \"\",\n      \"children\" : [ ]\n    }, {\n      \"name\" : \"message\",\n      \"value\" : \"success\",\n      \"description\" : \"\",\n      \"required\" : false,\n      \"dataType\" : \"String\",\n      \"type\" : null,\n      \"defaultValue\" : null,\n      \"validateType\" : \"\",\n      \"error\" : \"\",\n      \"expression\" : \"\",\n      \"children\" : [ ]\n    }, {\n      \"name\" : \"data\",\n      \"value\" : \"{\\\\\\\"key\\\\\\\":\\\\\\\"焼肉店\\\\\\\", \\\\\\\"en\\\\\\\":\\\\\\\"Yakiniku restaurant\\\\\\\", \\\\\\\"cn\\\\\\\":\\\\\\\"烧肉店\\\\\\\", \\\\\\\"jp\\\\\\\":\\\\\\\"焼肉店\\\\\\\", \\\\\\\"th\\\\\\\":\\\\\\\"ร้านยากินิกุ\\\\\\\"}\",\n      \"description\" : \"\",\n      \"required\" : false,\n      \"dataType\" : \"String\",\n      \"type\" : null,\n      \"defaultValue\" : null,\n      \"validateType\" : \"\",\n      \"error\" : \"\",\n      \"expression\" : \"\",\n      \"children\" : [ ]\n    }, {\n      \"name\" : \"timestamp\",\n      \"value\" : \"1720061483215\",\n      \"description\" : \"\",\n      \"required\" : false,\n      \"dataType\" : \"Long\",\n      \"type\" : null,\n      \"defaultValue\" : null,\n      \"validateType\" : \"\",\n      \"error\" : \"\",\n      \"expression\" : \"\",\n      \"children\" : [ ]\n    }, {\n      \"name\" : \"executeTime\",\n      \"value\" : \"4250\",\n      \"description\" : \"\",\n      \"required\" : false,\n      \"dataType\" : \"Integer\",\n      \"type\" : null,\n      \"defaultValue\" : null,\n      \"validateType\" : \"\",\n      \"error\" : \"\",\n      \"expression\" : \"\",\n      \"children\" : [ ]\n    } ]\n  }\n}\r\n================================\r\nimport request;\nimport http;\nimport log\nlog.info(\"test---->\"+body.test)\nvar API_KEY = \'c3e02c34c6b2454d9207210ef4f13ca6\'\nvar messageBody = {\n    content: \"\"\"你是一个专业的英语翻译团队领导,负责安排和协调团队成员完成高质量的翻译工作,力求实现\"信、达、雅\"的翻译标准。翻译流程如下:\n    第一轮翻译 - 直译阶段:追求忠实原文,将中文逐字逐句地译成英文,确保译文准确无误,不遗漏任何信息。\n    第二轮翻译 - 意译阶段。分开思考和翻译内容：\n【思考】第二轮翻译需要从多角度思考原文的深层含义,揣摩作者的写作意图,在忠实原文的同时,更好地传达文章的精髓。\n\n【翻译】在第二轮翻译中,在直译的基础上,深入理解原文的文化背景、语境和言外之意,从整体把握文章的中心思想和情感基调,用地道、符合中文表达习惯的语言进行意译,力求意境契合,易于理解。注意：只能逐句翻译原文，不要在末尾加上自己的总结。\n\n第三轮翻译 - 初审校对。分开思考和翻译内容：\n\n【思考】初审环节的关键是要全面审视译文,确保没有偏离原意,语言表达准确无误,逻辑清晰,文章结构完整。\n\n【翻译】第三轮翻译要静心回顾译文,仔细对比原文,找出偏差和欠缺之处,保证译文没有错漏、歧义和误解,补充完善相关内容,进一步修改和提升翻译质量。注意：只能逐句翻译原文，不要在末尾加上自己的总结。\n\n第四轮翻译 - 终审定稿:作为团队领导,你要亲自把关,综合各轮次的翻译成果,取长补短,集思广益,最终定稿。定稿译文必须忠实原文、语言流畅、表达准确、通俗易懂,适合目标读者阅读。将最终的翻译内容以 json 格式进行回显，其中en代表是英文翻译，cn代表是中文翻译，jp为日本翻译，th为泰语翻译key为我输入内容key，需要你自动识别是什么语言，json 格式参考如下，：\n[{\"key\"：\"权限\",\"en\":\"Permissions\"，\"cn\":\"权限\"，\"jp\":\"\"，\"th\":\"\"}]\n\n注意: 前三轮都不用输出，仅输出第四轮的最终翻译json的正文就可以即可。\n\n请严格按照以上翻译步骤和要求,逐段进行翻译。\n    \"\"\",\n    role: \"system\",\n}\nvar messageBody2 = {\n    role:\"user\",\n    content: body.test::stringify\n}\nvar param = []\nparam.push(messageBody)\nparam.push(messageBody2)\nlog.info(\"eee：---->\" + param)\nvar paramlast = {\n    \'messages\': param\n}\nlog.info(\"paramlast---->\" + paramlast::stringify)\nvar result = http.connect(\'https://it-able-openai01.openai.azure.com/openai/deployments/gpt4/chat/completions?api-version=2024-02-01\').contentType(\'application/json\').header({\n    \'api-key\': API_KEY\n}).body(paramlast::stringify).post().getBody();\nlog.info(\"openai返回\" + result)\nvar result2 = result.choices.message.content\nlog.info(\"result2---->\" + result2)\nreturn result2\n');
